public class strStr {
    private int[][]patArrBuilder(String pat){
        int len = pat.length(), rt = 0;
        char[] patA = pat.toCharArray();
        int[][] res = new int[len][256];
        res[0][patA[0]] = 1;
        for(int i = 1; i < len; i++){
            System.arraycopy(res[rt],0,res[i],0,256);
            res[i][patA[i]] = i+1;
            rt = res[rt][patA[i]];
        }
       return res;
    }
    public int strStrKMP(String haystack, String needle) {
        if(needle.length() == 0) return 0;
        if(haystack.length() == 0) return -1;
        int patArr[][] = patArrBuilder(needle);
        int nLen = needle.length();
        char[] hayA = haystack.toCharArray();
        int i = 0,j = 0;
        for(; i < hayA.length && j < nLen; i++) {
            j = patArr[j][hayA[i]];
        }
        if(j == nLen) return i-j;
        return -1;
    }
    //fastest version so far, not sure the internal mechanism of substring(int, int)
    //time complexity might be O(hLen * nLen)
    public int strStr(String haystack, String needle) {
        int nLen = needle.length();
        int hLen = haystack.length();
        if(nLen == 0) return 0;
        if(hLen == 0) return -1;
        if(hLen < nLen) return -1;
        for(int i = 0; i <= hLen-nLen; i++)
            if(haystack.substring(i,i+nLen).equals(needle))
                return i;
        return -1;
    }
    public static void main(String[] args){
        int res = new strStr().strStr("aaaaa","aaaab");
        res = new strStr().strStr(
           "",
                    ""
        );
        int i = 0;
    }
}
